void MASTER_CNN::thread_ap_clk_no_reset_() {
    if ( ap_rst_n_inv.read() == ap_const_logic_1) {
        ap_CS_fsm = ap_ST_fsm_state1;
    } else {
        ap_CS_fsm = ap_NS_fsm.read();
    }
    if ( ap_rst_n_inv.read() == ap_const_logic_1) {
        ap_reg_grp_CNN_1D_fu_110_ap_start = ap_const_logic_0;
    } else {
        if (((esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state2.read()) && 
              esl_seteq<1,1,1>(exitcond_fu_166_p2.read(), ap_const_lv1_0)) || 
             (esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state3.read()) && 
              esl_seteq<1,1,1>(ap_const_logic_0, ap_sync_grp_CNN_1D_fu_110_ap_ready.read())))) {
            ap_reg_grp_CNN_1D_fu_110_ap_start = ap_const_logic_1;
        } else if (esl_seteq<1,1,1>(ap_const_logic_1, grp_CNN_1D_fu_110_ap_ready.read())) {
            ap_reg_grp_CNN_1D_fu_110_ap_start = ap_const_logic_0;
        }
    }
    if ( ap_rst_n_inv.read() == ap_const_logic_1) {
        ap_sync_reg_grp_CNN_1D_fu_110_ap_ready = ap_const_logic_0;
    } else {
        if (esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state3.read())) {
            if (esl_seteq<1,1,1>(grp_CNN_1D_fu_110_ap_done.read(), ap_const_logic_1)) {
                ap_sync_reg_grp_CNN_1D_fu_110_ap_ready = ap_const_logic_0;
            } else if (esl_seteq<1,1,1>(ap_const_logic_1, grp_CNN_1D_fu_110_ap_ready.read())) {
                ap_sync_reg_grp_CNN_1D_fu_110_ap_ready = ap_const_logic_1;
            }
        }
    }
    if ((esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state3.read()) && 
         esl_seteq<1,1,1>(grp_CNN_1D_fu_110_ap_done.read(), ap_const_logic_1))) {
        i_reg_98 = i_1_reg_185.read();
    } else if ((esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state1.read()) && 
                esl_seteq<1,1,1>(ap_start.read(), ap_const_logic_1))) {
        i_reg_98 = ap_const_lv8_0;
    }
    if ((esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state1.read()) && esl_seteq<1,1,1>(ap_start.read(), ap_const_logic_1))) {
        Config_rep_s_reg_177 = Config_rep_s_fu_158_p3.read();
    }
    if (esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state2.read())) {
        i_1_reg_185 = i_1_fu_171_p2.read();
    }
}

